import React,{useState} from 'react';
import styled from 'styled-components';


const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);
    return (
        <Nav>
            <Container>

                <Hamburger onClick={() => setIsOpen(!isOpen)}>
                    <span></span>
                    <span></span>
                    <span></span>
                </Hamburger>
                <Menu isOpen={isOpen}>
                    <LinkWrapper>
                        <MenuLink href="">Sign In</MenuLink>
                        <MenuLink href="">HOME</MenuLink>
                        <MenuLink href="">CONTACT</MenuLink>
                        <MenuLink href="">TRENDING</MenuLink>
                        <Button>Sign In</Button>
                    </LinkWrapper>

                </Menu>
            </Container>
        </Nav>
    )
}

export default Navbar;

const Nav =styled.div`

    // display: flex;
    // justify-content: space-between;
    // align-items: center;
    // flex-wrap: wrap;
    background-color: #D8F6FA;
    position: absolute;
    top:0;
    left:0;
    right:0;
    z-index:3;
    width: 80%;

`


const Container =styled.div`

    display: flex;
    justify-content: space-between;
    width:100%;
    flex-wrap:wrap;
    max-width:2000px;
    margin:auto;
    padding:2rem;



`;
